import React, { Component } from "react";
import {
  Tabs,
  Tab,
  Grid,
  Cell,
  Card,
  CardTitle,
  CardActions,
  Button,
  CardMenu,
  IconButton,
  CardText,
} from "react-mdl";

class Projects extends Component {
  constructor(props) {
    super(props);
    this.state = { activeTab: 0 };
  }
  toggleCategories() {
    if (this.state.activeTab === 0) {
      return (
        <Card shadow={5} style={{ minWidth: "450", margin: "auto" }}>
          <CardTitle
            style={{
              color: "#fff",
              height: "176px",
              background: "url(https://dwglogo.com/wp-content/uploads/2017/09/1460px-React_logo.png) center / cover",
            }}
          ></CardTitle>
          <CardText>Lorem Ipsum</CardText>
          <CardActions border>
            <Button colored>Github</Button>
            <Button colored>Link</Button>
          </CardActions>
          <CardMenu style={{ color: "#fff" }}>
            <IconButton name="share" />
          </CardMenu>
        </Card>
      );
    } else if (this.state.activeTab === 1) {
      return (
        <Card shadow={5} style={{ minWidth: "450", margin: "auto" }}>
        <CardTitle
          style={{
            color: "#fff",
            height: "176px",
            background: "url(https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcTY2anINYJoeteqMt-Qzrke0eCiyPSGhEQaGw&usqp=CAU) center / cover",
          }}
        ></CardTitle>
        <CardText>Lorem Ipsum</CardText>
        <CardActions border>
          <Button colored>Github</Button>
          <Button colored>Link</Button>
        </CardActions>
        <CardMenu style={{ color: "#fff" }}>
          <IconButton name="share" />
        </CardMenu>
      </Card>
      );
    } else if (this.state.activeTab === 2) {
      return (
        <div>
          <h1>This is Nodejs</h1>
        </div>
      );
    }
  }

  render() {
    return (
      <div className="category-tabs">
        <Tabs
          activeTab={this.state.activeTab}
          onChange={(tabId) => this.setState({ activeTab: tabId })}
          ripple
        >
          <Tab>React</Tab>
          <Tab>Javascript</Tab>
          <Tab>Nodejs</Tab>
        </Tabs>
        <Grid className="projects-grid">
          <Cell col={12}>
            <div className="content">{this.toggleCategories()}</div>
          </Cell>
        </Grid>
        {this.toggleCategories()}
      </div>
    );
  }
}

export default Projects;
